pragma solidity ^0.8.0;

import "./datastore.sol";

contract ProposalContract {
    address personnelDataAddr;

    constructor(address _personnelDataAddr) public payable {
        personnelDataAddr = _personnelDataAddr;
    }

    struct Proposal {
        address createdBy;
        uint256 voteYes;
        uint256 voteNo;
        uint256 budget;
        uint256 votingEndTime;
    }

    // Map of `proposal` structs.
    mapping(string => Proposal) proposals;
    mapping(string => Proposal) winningProposals;

    // List of proposal names
    string[] proposalNames;
    string[] winningProposalNames;

    // get all proposals
    function getAllProposals() public view returns (string[] memory) {
        return proposalNames;
    }

    function getProposalInfo(string calldata name)
        public
        view
        returns (Proposal memory)
    {
        return proposals[name];
    }

    // add a new proposal
    function addProposal(
        string calldata proposalName,
        uint256 _budget,
        uint256 _votingPeriod
    ) public {
        proposals[proposalName] = Proposal({
            createdBy: tx.origin,
            voteYes: 0,
            voteNo: 0,
            budget: _budget,
            votingEndTime: block.timestamp + _votingPeriod
        });

        proposalNames.push(proposalName);
    }

    // vote for proposal
    function voteProposal(string calldata _proposalName, bool voteYesNo)
        public
        returns (string memory)
    {
        Datastore personnelData = Datastore(personnelDataAddr);
        string memory voterName = personnelData.getVoter(tx.origin);
        string memory voterProposalStatus = personnelData.getVoterProposal(
            tx.origin,
            _proposalName
        );

        // check if voter exists
        if (keccak256(bytes(voterName)) == keccak256(bytes(""))) {
            return "voter does not exist";
        }

        // check if voter has voted. if value is not "yes" or "no", return
        if (keccak256(bytes(voterProposalStatus)) != keccak256(bytes(""))) {
            return "voter has voted. No changes have been made";
        }

        // check if proposal exists, voting period has ended
        address createdBy = proposals[_proposalName].createdBy;
        uint256 votingEndTime = proposals[_proposalName].votingEndTime;
        if (createdBy == address(0)) {
            return "no proposal found";
        } else if (block.timestamp > votingEndTime) {
            return "voting period has ended. No changes have been made";
        } else {
            if (voteYesNo) {
                proposals[_proposalName].voteYes += 1;
                // set voter's vote details for project to yes
                personnelData.addVoterProposal(tx.origin, _proposalName, "yes");
            } else {
                proposals[_proposalName].voteNo += 1;
                // set voter's vote details for project to no
                personnelData.addVoterProposal(tx.origin, _proposalName, "no");
            }
            return "vote has been made";
        }
    }

    function removeEndedProposals() public returns (string[] memory) {
        Datastore personnelData = Datastore(personnelDataAddr);
        uint256 numVoters = personnelData.getVoters().length;

        for (uint256 i = proposalNames.length - 1; i > 0; i--) {
            string memory proposalName = proposalNames[i];
            Proposal memory proposal = proposals[proposalName];

            // move winning proposals to another array
            uint256 totalVotes = proposal.voteYes + proposal.voteNo;
            if (totalVotes > 0 && numVoters > 0) {
                uint256 percentageWinning = (proposal.voteYes / totalVotes) *
                    100;
                uint256 percentageVoted = (totalVotes / numVoters) * 100;
                if (percentageWinning > 50 && percentageVoted >= 80) {
                    winningProposalNames.push(proposalName);
                    winningProposals[proposalName] = proposal;
                    Proposal memory empty;
                    proposals[proposalName] = empty;
                    delete proposalNames[i];
                }
            }

            // delete all ended proposals
            if (block.timestamp > proposal.votingEndTime) {
                Proposal memory empty;
                proposals[proposalName] = empty;
                delete proposalNames[i];
            }
        }

        // have to do one more for the index 0 coz solidity is trash
        string memory firstProposalName = proposalNames[0];
        Proposal memory firstProposal = proposals[firstProposalName];
        uint256 firstTotalVotes = firstProposal.voteYes + firstProposal.voteNo;

        // move winning proposal to another array
        if (firstTotalVotes > 0 && numVoters > 0) {
            uint256 firstPercentageWinning = (firstProposal.voteYes /
                firstTotalVotes) * 100;
            uint256 firstPercentageVoted = (firstTotalVotes / numVoters) * 100;
            if (firstPercentageWinning > 50 && firstPercentageVoted >= 80) {
                winningProposalNames.push(firstProposalName);
                winningProposals[firstProposalName] = firstProposal;
                Proposal memory empty;
                proposals[firstProposalName] = empty;
                delete proposalNames[0];
            }
        }

        // delete ended proposals
        if (block.timestamp > firstProposal.votingEndTime) {
            Proposal memory empty;
            proposals[firstProposalName] = empty;
            delete proposalNames[0];
        }
        return proposalNames;
    }

    // get all winning proposals
    function getAllWinningProposals() public view returns (string[] memory) {
        return winningProposalNames;
    }
}
